package edu.matc.entity;/** * Created on 11/10/17 at 12:52 PM * * @author nfenev */public class Holiday {    private String name;    private String date;    private String national;    /**     * Gets name.     *     * @return the name     */    public String getName() {        return name;    }    /**     * Sets name.     *     * @param name the name     */    public void setName(String name) {        this.name = name;    }    /**     * Gets date.     *     * @return the date     */    public String getDate() {        return date;    }    /**     * Sets date.     *     * @param date the date     */    public void setDate(String date) {        this.date = date;    }    /**     * Gets national.     *     * @return the national     */    public String getNational() {        return national;    }    /**     * Sets national.     *     * @param national the national     */    public void setNational(String national) {        this.national = national;    }}